-- Please update version.sql too -- this keeps clean builds in sync
define version=2782
define minor_version=0
@update_header

declare
	v_ver number;
begin
	select db_version into v_ver from mail.version;
	if v_ver NOT IN (27,28,29) then
		raise_application_error(-20001, 'Mail schema is not version 27, 28 OR 29');
	end if;
end;
/

-- *** DDL ***
-- Create tables

-- Alter tables
declare
	v_cnt number;
begin
	for r in (select 1 from all_constraints where owner='MAIL' and table_name='ACCOUNT_MESSAGE' and constraint_name='FK_MSG_ACCOUNT_MSG') loop
		execute immediate 'alter table mail.account_message drop constraint fk_msg_account_msg';
	end loop;
	select count(*) into v_cnt from all_constraints where owner='MAIL' and table_name='ACCOUNT_MESSAGE' and constraint_name='FK_ACCOUNT_MSG_MAILBOX_MSG';
	if v_cnt = 0 then
		execute immediate 'alter table mail.account_message add constraint FK_ACCOUNT_MSG_MAILBOX_MSG foreign key (mailbox_sid, message_uid) '||
			'references mail.mailbox_message (mailbox_sid, message_uid)';
	end if;
	select count(*) into v_cnt from all_indexes where owner='MAIL' and index_name='IX_MAILBOX_MSG_MSG';
	if v_cnt = 0 then
		execute immediate 'CREATE INDEX MAIL.IX_MAILBOX_MSG_MSG ON MAIL.MAILBOX_MESSAGE(MESSAGE_ID)';
	end if;
	select count(*) into v_cnt from all_constraints where owner='MAIL' and table_name='MAILBOX_MESSAGE' and constraint_name='FK_MAILBOX_MESSAGE_MESSAGE';
	if v_cnt = 0 then 
		execute immediate 'ALTER TABLE MAIL.MAILBOX_MESSAGE ADD CONSTRAINT FK_MAILBOX_MESSAGE_MESSAGE  '||
			'FOREIGN KEY (MESSAGE_ID) REFERENCES MAIL.MESSAGE(MESSAGE_ID)';
	end if;
end;
/

begin
	for r in (select owner, object_name from all_objects where owner='MAIL' and object_type='JAVA SOURCE') loop
		execute immediate 'drop java source '||r.owner||'."'||r.object_name||'"';
	end loop;
	for r in (select owner, object_name from all_objects where owner='MAIL' and object_type='JAVA CLASS') loop
		execute immediate 'drop java class '||r.owner||'."'||r.object_name||'"';
	end loop;
	for r in (select owner, object_name from all_objects where owner='MAIL' and object_type='FUNCTION' 
		and object_name IN ('GNUHASH_SHA1', 'GNUHASH_SHA256', 'GNUHASH_SHA512', 'SHA1', 'SHA256', 'SHA512')) loop
		execute immediate 'drop function '||r.owner||'."'||r.object_name||'"';
	end loop;
end;
/

begin
	for r in (select 1 from all_tables where owner='MAIL' and table_name='LOAD_JAVA') loop
		execute immediate 'drop table mail.load_java';
	end loop;
end;
/

