declare
	v_ver					number;
	v_class					all_objects.object_name%TYPE;
	v_last_class			all_objects.object_name%TYPE;
	v_class_type			all_objects.object_type%TYPE;
	v_cnt					number;
	e_oci_success_with_info exception;
	pragma exception_init(e_oci_success_with_info, -24344);
	e_class_in_use			exception;
	pragma exception_init(e_class_in_use, -29553);
begin
	v_ver := dbms_db_version.version;

	for r in (select fn, ver
				from mail.load_java
			   where ver in (0, v_ver)
			     and fn like '%.class'
			   order by v_ver desc) loop
		begin
			execute immediate 'create or replace and resolve java class schema mail '||
				'using blob (select data from mail.load_java where ver='||r.ver||' and fn='''||r.fn||''')';
		exception
			when e_oci_success_with_info then
				dbms_output.put_line(r.fn||': caught oci_success_with_info, code: '||sqlcode||', message: '||sqlerrm);
		end;
	end loop;
	for r in (select fn, ver
				from mail.load_java
			   where ver in (0, v_ver)
			     and fn like '%.java'
			   order by v_ver desc) loop
		begin
			execute immediate 'create or replace and resolve java source named mail."'||replace(r.fn,'.java','')||
				'" using blob (select data from mail.load_java where ver='||r.ver||' and fn='''||r.fn||''')';
		exception
			when e_oci_success_with_info then
				dbms_output.put_line(r.fn||': caught oci_success_with_info, code: '||sqlcode||', message: '||sqlerrm);
		end;
	end loop;
	
	loop
		select min(object_name), count(*)
		  into v_class, v_cnt
		  from all_objects 
		 where owner = 'MAIL'
		   and object_type IN ('JAVA CLASS', 'JAVA SOURCE')
		   and status = 'INVALID';
		exit when v_class IS NULL;

		if v_last_class = v_class then
			raise_application_error(-20001, 'Cannot resolve java errors for mail.'||v_last_class);
		end if;

		begin
			select object_type
			  into v_class_type
			  from all_objects
			 where owner = 'MAIL'
			   and object_name = v_class;

			if v_class_type = 'JAVA SOURCE' then
				execute immediate 'alter java source mail."'||v_class||'" compile';
			else
				execute immediate 'alter java class mail."'||v_class||'" resolve';
			end if;
		exception
			when e_class_in_use then
				dbms_output.put_line('ignoring class in use error for class: '||v_class);
		end;
		v_last_class := v_class;
	end loop;
	
	if v_ver = 10 then
		execute immediate 'CREATE OR REPLACE FUNCTION mail.sha1 (in_blob IN BLOB) RETURN RAW DETERMINISTIC PARALLEL_ENABLE AS '||
       		'LANGUAGE JAVA NAME ''GNUSHA1.calcHash(oracle.sql.BLOB) return byte[]'';';
		execute immediate 'CREATE OR REPLACE FUNCTION mail.sha256 (in_blob IN BLOB) RETURN RAW DETERMINISTIC PARALLEL_ENABLE AS '||
       		'LANGUAGE JAVA NAME ''GNUSHA256.calcHash(oracle.sql.BLOB) return byte[]'';';
		execute immediate 'CREATE OR REPLACE FUNCTION mail.sha512 (in_blob IN BLOB) RETURN RAW DETERMINISTIC PARALLEL_ENABLE AS '||
       		'LANGUAGE JAVA NAME ''GNUSHA512.calcHash(oracle.sql.BLOB) return byte[]'';';
	else
		execute immediate 'CREATE OR REPLACE FUNCTION mail.sha1 (in_blob IN BLOB) RETURN RAW DETERMINISTIC PARALLEL_ENABLE AS '||
       		'LANGUAGE JAVA NAME ''SHA.SHA1(oracle.sql.BLOB) return byte[]'';';
		execute immediate 'CREATE OR REPLACE FUNCTION mail.sha256 (in_blob IN BLOB) RETURN RAW DETERMINISTIC PARALLEL_ENABLE AS '||
       		'LANGUAGE JAVA NAME ''SHA.SHA256(oracle.sql.BLOB) return byte[]'';';
		execute immediate 'CREATE OR REPLACE FUNCTION mail.sha512 (in_blob IN BLOB) RETURN RAW DETERMINISTIC PARALLEL_ENABLE AS '||
       		'LANGUAGE JAVA NAME ''SHA.SHA512(oracle.sql.BLOB) return byte[]'';';
	end if;		
end;
/

begin
	for r in (select 1 from all_tables where owner='MAIL' and table_name='LOAD_JAVA') loop
		execute immediate 'drop table mail.load_java';
	end loop;
end;
/

